import React from 'react';
import Paper from "@material-ui/core/Paper";

const Question = ({getQuestionId, question}) => {

    const q = question;
    const qt = getQuestionId(q);

    return(
        <Paper>
            <h1>Detail's page</h1>  
            <p>{qt.title}</p>
        </Paper>
    )
}
export default Question;
